import {useContext} from 'react';
import { ScrapeContext} from './scrapeContext';

const Data = ()=> {
  const scrapeData = useContext(ScrapeContext)
  return (<div>
    <h2>Your data</h2>
    {scrapeData.hey}
  </div>)
}

export default Data;
